import React from "react";
import "./style.css";

const Header = props => (
  <div>
    <p>
      <strong>longitude: {props.laT1}</strong>
    </p>
    <p>
      <strong>longitude: {props.lnG1}</strong>
    </p>
  </div>
);

export default Header;
